<template>
  <div class="checkup-page">
   <img src="data:image/png;base64," />
  </div>
</template>

<script setup>
import {onMounted, reactive,ref} from "vue";

const personInfo = reactive({});
const record=reactive({});
const recordNum=ref(0);

onMounted( async () => {
  // 读取病人信息缓存以及体检项目缓存
  const cachedInfo = localStorage.getItem("PersonInfo");
  if(cachedInfo){
    personInfo.value=JSON.parse(cachedInfo);
  }

  const cachedCompletedRecord = localStorage.getItem("CompletedRecord");
  if(cachedCompletedRecord){
    record.value=JSON.parse(cachedCompletedRecord);
    recordNum.value=record.value.length;
  }

  console.log(record.value);

})


</script>

